import React, { Component } from 'react';
import PropTypes from 'prop-types';
//import { Test } from './SocialNetworks.styles';
import './RrssStyles.scss'

class SocialNetworks extends Component { 
  constructor(props) {
    super(props);

    this.state = {
      hasError: false,
    };
  }

 

  render () {
    if (this.state.hasError) {
      return <h1>Something went wrong.</h1>;
    }

    const mainRRSS = this.props.mainRRSS
    .map((icons, i)=>{
      return (
        <span key={i}>{icons} 
          <input type="text" 
          name={icons}
          onChange={this.props.handleInput}
          placeholder="@usuario"/>
        </span>
        )
    })
    
    return (
      <div className="SocialNetworksWrapper">

          {mainRRSS}
          <div className="rrss-list">
            <button className="rrss-icon" type="button" value="Facebook"  onClick={this.props.addRrss}><img src="data:image/png;base64," alt=""/></button>
            <button className="rrss-icon" type="button" value="Twitter"  onClick={this.props.addRrss}><img src="data:image/png;base64," alt=""/></button>
            <button className="rrss-icon" type="button" value="Instagram"  onClick={this.props.addRrss}><img src="data:image/jpeg;base64," alt=""/></button>
            <button className="rrss-icon" type="button" value="LinkedIn"  onClick={this.props.addRrss}><img src="data:image/png;base64," alt=""/></button>
            <button className="rrss-icon" type="button" value="Snapchat"  onClick={this.props.addRrss}><img src="https://cdn0.iconfinder.com/data/icons/social-flat-rounded-rects/512/snapchat-512.png" alt=""/></button>
            <button className="rrss-icon" type="button" value="Telegram"  onClick={this.props.addRrss}><img src="http://telegram.com.es/wp-content/uploads/2018/02/telegram.png" alt=""/></button>
            <button className="rrss-icon" type="button" value="Whatsapp"  onClick={this.props.addRrss}><img src="data:image/png;base64," alt=""/></button>
            <button className="rrss-icon" type="button" value="Youtube"  onClick={this.props.addRrss}><img src="https://cdn.icon-icons.com/icons2/1584/PNG/512/3721679-youtube_108064.png" alt=""/></button>
            <button className="rrss-icon" type="button" value="Pinterest"  onClick={this.props.addRrss}><img src="data:image/png;base64," alt=""/></button>
  
          </div>
      </div>
    );
  }
}

SocialNetworks.propTypes = {
  // bla: PropTypes.string,
};

SocialNetworks.defaultProps = {
  // bla: 'test',
};

export default SocialNetworks;
